    this.state = {test: [1,2,3,4,5,6,7]}
  }
  render(){
    let wallExample = this.state.test.map((item,key) =>{
      return <div key={key} className='profileWall'> </div>
    });
    let example = this.state.test.map((item, key) =>{
      return <img key={key} src={userPhoto}/>
    });
